import './App.css';
import Navbar from './components/Navbar';
import React from 'react';
import {BrowserRouter as Router, Route } from 'react-router-dom';
import Home from './components/pages/Home';

function App() {
  return (
    <>
    <Router>
      <Navbar/>
          <h1>MySpace</h1>
          <Route path='/' exact />
    </Router>
    </>
  );
}

export default App;
